import React from 'react';
import './Login.css';

function login() {
  return (
    <div className='card'>
        <h1> Login</h1>
        <div className='textbox'>
            <input type='text' placehorder="Username"></input>
        </div>
        <div className='textbox'>
            <input type='password' placehorder="Password"></input>
        </div>     
        <button>Login</button>
            <div>
            <button>Register</button>
            </div>
    </div>
  );
}

export default login;
